Luire c'est une décision;
Trouve rage et désarroi;
La perfection se plie à la définition;
Les vestiges par abnégation,
Se parle historiquement,
Jusqu'à la constance;
Se fige la vérité séduisante,
Subodorer la vertu,
Que percevoir de la constance;
Une entité cela fait longtemps.

